import React from "react";
import "./landing_top.css"

function landing_top() {
  return (
    <div>
      <div class="jumbotron text-center">
        <h1>store7</h1>
        <p>We deliver happiness</p>
      </div>
    </div>
  );
}

export default landing_top;
